function OpenLoading() {
    $("#floatingBarsG").show();
}
function CloseLoading() {
    $("#floatingBarsG").hide();
}
function OpenSpinner() {
    $("#spinner").fadeIn(100);
}
function CloseSpinner() {
    $("#spinner").fadeOut(100);
}
function ErrorSpinner() {
    $(".spinner").addClass("error");
    $(".spinner").parent().append("<span id='spinnermsg' style='position: fixed; margin: 4.2em -4.3em; color: rgb(241, 141, 5);'>Gagal memuat halaman</span>");
    setTimeout(function () {
        $("#spinner").fadeOut(100);
        $("#spinnermsg").remove();
        $(".spinner").removeClass("error");
    }, 1000)
}
function toRp(angka){
	    var rev     = parseInt(angka, 10).toString().split('').reverse().join('');
	    var rev2    = '';
	    for(var i = 0; i < rev.length; i++){
	        rev2  += rev[i];
	        if((i + 1) % 3 === 0 && i !== (rev.length - 1)){
	            rev2 += '.';
	        }
	    }
	    return rev2.split('').reverse().join('') + ',00';
	}
function json2array(json){
    var result = [];
    var keys = Object.keys(json);
    keys.forEach(function(key){
        result.push(json[key]);
    });
    return result;
}
